import React from 'react';
import { Article } from '../types/nyt';

interface ItemDetailProps {
    article: Article;
}

const ItemDetail: React.FC<ItemDetailProps> = ({ article }) => {
    return (
        <div>
            <h2>{article.title}</h2>
            {article.multimedia && article.multimedia[0] && (
                <img src={article.multimedia[0].url} alt={article.title} />
            )}
            <p>{article.abstract}</p>
            <p>{article.byline}</p>
            <p>Published: {article.published_date}</p>
            <a href={article.url} target="_blank" rel="noopener noreferrer">Read full article</a>
        </div>
    );
};

export default ItemDetail;
